import Apcard from "./apcard";

function Landing() {
    return (
        <div style={styles.container}>
            <Apcard
                heading="Uplinks"
                count="2/3"
                status="Healthy"
            />
            <Apcard
                heading="Switches"
                count="11/25"
                status="Healthy"
            />
            <Apcard
                heading="Switches"
                count="11/25"
                status="Healthy"
            />
        </div>
    );
}

export default Landing;

const styles = {
    container: {
        display: 'flex',
        alignItems: 'center',
        gap: '20px',
        marginTop: '20px',
    },
    card: {
        border: '1px solid #ddd',
        borderRadius: '8px',
        boxShadow: '0 2px 8px rgba(0, 0, 0, 0.29)',
        padding: '15px',
        flex: 1, // This allows cards to grow and fill available space
    },
};
